Logo Redin is a simple dependency injection framework, instead of having a bunch of features, we provide a limited set of features that must be enough for the majority of projects, mainly the smaller ones. Redin provides a Kotlin DSL for declaration of dependencies: val injector = Redin { bind<AccountService>() toImplementation(AccountServiceImpl::class.java)
} val serviceProvider = injector.provide<AccountService>() Note that, the provide function returns a function that, when invoked, produces the underlying requested dependency. This means that, every time you do serviceProvider() it creates a new instance of this service. If that is not what you want, you could use scopes to define the scope of the dependency. Once an instance of a dependency is produced in a given scope, the instance keeps tied to that scope. So, calling the serviceProvider always yields the same dependency instance. The most commonly used scope is SINGLETON: val injector = Redin { bind<AccountService>() inScope SINGLETON toImplementation(AccountServiceImpl::class.java)
} val service = injector.provide<AccountService>(scope = SINGLETON) Also, you could use qualifiers to identify between different instances of the same type of dependency, for example, for services urls: val injector = Redin { bind<String>() qualifiedWith Name("accountService") inScope SINGLETON toValue "https://service/" bind<String>() qualifiedWith Name("transactionService") inScope SINGLETON toValue "https://service2/"
} val service = injector.provide<String>( scope = SINGLETON, qualifiers = listOf(nameContainer("transactionService"))
)

