To use class injection, you need to annotate the constructor to be used to inject the dependencies with @Inject, see an example below: data class Account(val id: Long) interface AccountService { fun deposit(account: Account, amount: Long)
} class AccountServiceImpl : AccountService { override fun deposit(account: Account, amount: Long) { // Deposit logic }
} class BankService @Inject constructor(val accountService: AccountService) fun inject() { val injector = Redin { bind<AccountService>() inScope SINGLETON toImplementation(AccountServiceImpl::class.java) bind<BankService>() inScope SINGLETON toImplementation(BankService::class.java) } val accountService = injector.provide<AccountService>(scope = SINGLETON) val bankService = injector.provide<BankService>(scope = SINGLETON)
}

