Qualifiers are used to identify between different dependencies of the same type. The most common qualifier is the Named qualifier: val injector = Redin { bind<String>() inScope SINGLETON qualifiedWith Name("databaseUri") toValue "localhost:8090"
} To query dependencies by qualifier, we need to use AnnotationContainer, however we heavily recommend providing wrappers around AnnotationContainer for the ease of use, just like we do for Named annotations: val injector = Redin { bind<String>() inScope SINGLETON qualifiedWith Name("databaseUri") toValue "localhost:8090"
} val uri = injector.provide<String>(scope = SINGLETON, qualifiers = listOf(nameQualifier("databaseUri")))()

