Child injectors could be used to inherit dependencies from a parent injector, while providing a whole new scope of dependencies. One example of usage of child injector is in plugin system, to provide a dedicated Logger for every plugin. The example below shows an example of a “plugin system” taking advantage of child injectors: data class Project(val name: String)
abstract class Plugin { abstract fun init()
}
class PluginA @Inject constructor(val logger: Logger, val project: Project, val injector: Injector): Plugin() { override fun init() { logger.info("Plugin A initialized for project ‘${this.project.name}’!") }
}
class PluginB @Inject constructor(val logger: Logger, val project: Project, val injector: Injector): Plugin() { override fun init() { logger.info("Plugin B initialized for project ‘${this.project.name}’!") }
} val injector = Redin { bind<Project>() inScope SINGLETON toValue Project("Test")
} val pluginClasses = listOf(PluginA::class.java, PluginB::class.java)
val pluginInstances = mutableListOf<Plugin>() for (pluginClass in pluginClasses) { val pluginInjector = injector.child { bind<Logger>().inSingletonScope().toValue(Logger.getLogger(pluginClass.name)) } pluginInstances.add(pluginInjector[pluginClass])
} pluginInstances.forEach(Plugin::init)

