In scenarios like this one, you may want to retrieve all Plugin instances. Redin tries to not introduce any unexpected behavior, then a regular binding won't work, since binding to the same type overwrites the previous binding. To access all instances of a given type, you need to register a binding for a provider which carries all those instances. You can also use qualifiers to automatically provide these instances using an identifier as well. The example below shows how to provide all instances of a given type through a List, as well as using qualifiers to provide dedicated bindings: data class Project(val name: String)
abstract class Plugin { abstract val id: String abstract fun init()
}
class PluginA @Inject constructor(val logger: Logger, val project: Project, val injector: Injector): Plugin() { override val id: String = "com.example.PluginA" override fun init() { logger.info("Plugin A initialized for project ‘${this.project.name}’!") }
}
class PluginB @Inject constructor(val logger: Logger, val project: Project, val injector: Injector): Plugin() { override val id: String = "com.example.PluginB" override fun init() { logger.info("Plugin B initialized for project ‘${this.project.name}’!") }
}
class PluginC @Inject constructor(val logger: Logger, val project: Project, @Named("com.example.PluginB") val pluginB: Plugin, val injector: Injector): Plugin() { override val id: String = "com.example.PluginC" override fun init() { logger.info("Plugin C initialized for project ‘${this.project.name}’!") }
} val injector = Redin { bind<Project>() inScope SINGLETON toValue Project("Test")
} val pluginClasses = listOf(PluginA::class.java, PluginB::class.java, PluginC::class.java)
val pluginInstances = mutableListOf<Plugin>() injector.bind { bindReified<List<Plugin>>().inSingletonScope().toProvider { pluginInstances }
} for (pluginClass in pluginClasses) { val pluginInjector = injector.child { bind<Logger>().inSingletonScope().toValue(Logger.getLogger(pluginClass.name)) } val pluginInstance = pluginInjector[pluginClass] pluginInstances.add(pluginInjector[pluginClass]) injector.bind { bind<Plugin>().inSingletonScope().qualifiedWith(Name(pluginInstance.id)).toValue(pluginInstance) }
} pluginInstances.forEach(Plugin::init) class PluginSystem @Inject constructor(@Singleton val plugins: List<Plugin>) injector.bind { bind<PluginSystem>().inSingletonScope().toImplementation<PluginSystem>()
} val system = injector.provide<PluginSystem>(scope = SINGLETON)() The bindReified function is used when you want to bind keeping the generic type information, rather than erasing the type information. You could also use bind(TypeInfo.builderOf(List::class.java).of(Plugin::class.java).buildGeneric())

