Redin allows for switching existing injections into new ones, this is possible through HotSwappable. interface Logger { fun info(message: String)
} class PrefixedLogger(val prefix: String): Logger { override fun info(message: String) { println("$prefix: $message") }
} class MyPlugin @Inject constructor(@HotSwappable val globalLogger: Hot<Logger>) { fun log(message: String) { this.globalLogger.value.info("MyPlugin: ‘$message’") } } fun hotInject() { val injector = Redin { bind<Logger>().inSingletonScope().toValue(PrefixedLogger("First")) bind<MyPlugin>().inSingletonScope().toImplementation<MyPlugin>() } val myPlugin = injector.provide<MyPlugin>(scope = SINGLETON)() myPlugin.log("Hello") injector.bind { bind<Logger>().inSingletonScope().toValue(PrefixedLogger("Swapped")) } myPlugin.log("Hello") } Proxies can be used like in lazy injection , with zero runtime overhead (only class generation overhead, which happens only once in the entire execution): interface Logger { fun info(message: String)
} class PrefixedLogger(val prefix: String): Logger { override fun info(message: String) { println("$prefix: $message") }
} class MyPlugin @Inject constructor(@HotSwappable val globalLogger: Logger) { fun log(message: String) { this.globalLogger.info("MyPlugin: ‘$message’") } } @Test
fun hotInject() { val injector = Redin { bind<Logger>().inSingletonScope().toValue(PrefixedLogger("First")) bind<MyPlugin>().inSingletonScope().toImplementation<MyPlugin>() } val myPlugin = injector.provide<MyPlugin>(scope = SINGLETON)() myPlugin.log("Hello") injector.bind { bind<Logger>().inSingletonScope().toValue(PrefixedLogger("Swapped")) } myPlugin.log("Hello") }

